import React, { Component } from "react";
import Stock from "./Stock";

import {
    Route,
    NavLink,
    HashRouter
  } from "react-router-dom";
import allDonor from "./allDonor";

class StockHome extends Component{
    
    
        
    render() {
        return (
            <HashRouter>
            <div>
            <br></br>
            <ul className="header"> 
          
          <li><NavLink exact to="/Donor">Donor</NavLink></li>
          <li><NavLink to ="/search">Search Donor</NavLink></li>
          <li><NavLink to ="/Stock">Stock</NavLink></li>
          <li><NavLink to ="/DeleteDonor">Delete Donor</NavLink></li>
          <li><NavLink to ="/">Exit</NavLink></li>

         </ul> 
                <div style={{
                               display: "flex",
                               justifyContent: "center",
                               alignItems: "center"
                              }} >
                <button><NavLink exact to="/allstock">Show Blood Stock</NavLink></button>
                <button><NavLink to ="/updateStock">Update Stock</NavLink></button>
                <div>
                {/* <Route exact path="/allstock" component={Stock}/>
            <Route path="/updateStock" component={allDonor}/> */}
              
            </div>
                </div>
                </div>
                </HashRouter>
        );
    }
}
export default StockHome
